import React from "react"
import {Field} from "redux-form";
import {Input,CreateField} from "../../assetss/common/ValidatorsComponents/ElementsValidators";
import pc from './UserInfo.module.css'
import {MaxLengthCreator} from "../../utils/validators";

const ContactsEditorForm = (props) => {

    const maxLength50 = MaxLengthCreator(50)
    const maxLength30 = MaxLengthCreator(30)
    return <div>
        <form onSubmit={props.handleSubmit}>
            <div>
                {CreateField("Enter your full name","fullName",[],Input)}
            </div>

            <div>
                <Field name={'password'} placeholder={"Enter the password"}
                       component={Input} type={"password"}
                       validate={[]}/>

            </div>

            {props.error
                ?
                <div className={pc.FormError}>
                    {props.error}
                </div>
                : null}

        </form>
    </div>
}

export default ContactsEditorForm
